import React from "react";
import PieChartComponent from "./PieChartComponent";
import BarChartComponent from "./BarChartComponent";
import RouteLineChart from "./RouteLineChart";
import AgeGroupDetails from "./AgeGroupDetails";
import { useNavigate } from "react-router-dom";
import inflightLogo from "../assets/inflight-logo.png";

function Dashboard() {
  const navigate = useNavigate();

  return (
    <div style={{ padding: "2rem", backgroundColor: "#ffffff" }}>
      {/* Header */}
      <div style={{
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        marginBottom: "2rem"
      }}>
        <div style={{ display: "flex", alignItems: "center" }}>
          <img
            src={inflightLogo}
            alt="In-Flight Insights Logo"
            style={{ width: "70px", height: "70px", marginRight: "1rem" }}
          />
          <h1 style={{
            fontSize: "2rem",
            fontWeight: "bold",
            color: "#2b6cb0"
          }}>
            In-Flight Insights Dashboard
          </h1>
        </div>

        <div style={{ display: "flex", gap: "2rem", fontWeight: "bold" }}>
          <span style={{ cursor: "pointer", color: "#2b6cb0" }} onClick={() => navigate("/dashboard")}>Dashboard</span>
          <span style={{ cursor: "pointer", color: "#2b6cb0" }} onClick={() => navigate("/sop")}>SOP</span>
          <span style={{ cursor: "pointer", color: "#2b6cb0" }} onClick={() => navigate("/savings")}>Savings</span>
        </div>
      </div>

      {/* KPI Summary Cards */}
      <div style={{
        display: "flex",
        gap: "2rem",
        marginBottom: "2rem",
        flexWrap: "wrap",
        justifyContent: "center"
      }}>
        <div style={{
          background: "linear-gradient(to right, #e0f7e9, #e3f2fd)",
          padding: "2rem",
          borderRadius: "16px",
          flex: 1,
          textAlign: "center",
          minWidth: "220px"
        }}>
          <h2 style={{ fontSize: "1.5rem" }}>üí∞ Cost Savings</h2>
          <p style={{ fontSize: "2rem", fontWeight: "bold", marginTop: "1rem" }}>$1.2M</p>
        </div>
        <div style={{
          background: "linear-gradient(to right, #e0f7e9, #e3f2fd)",
          padding: "2rem",
          borderRadius: "16px",
          flex: 1,
          textAlign: "center",
          minWidth: "220px"
        }}>
          <h2 style={{ fontSize: "1.5rem" }}>‚ôªÔ∏è Waste Saved</h2>
          <p style={{ fontSize: "2rem", fontWeight: "bold", marginTop: "1rem" }}>210 kg</p>
        </div>
        <div style={{
          background: "linear-gradient(to right, #e0f7e9, #e3f2fd)",
          padding: "2rem",
          borderRadius: "16px",
          flex: 1,
          textAlign: "center",
          minWidth: "220px"
        }}>
          <h2 style={{ fontSize: "1.5rem" }}>üõ´ Routes Analyzed</h2>
          <p style={{ fontSize: "2rem", fontWeight: "bold", marginTop: "1rem" }}>350</p>
        </div>
      </div>

      {/* Chart Section: Pie + Route Line in Gray Boxes */}
      <div style={{ display: "flex", gap: "2rem", alignItems: "flex-start", paddingTop: "2rem", marginBottom: "2rem" }}>
        <div style={{
          flex: 1,
          backgroundColor: "#f7f7f7",
          border: "1px solid #ccc",
          borderRadius: "12px",
          padding: "1.5rem"
        }}>
          <h2 style={{ marginBottom: "1rem" }}>Overall Food Consumption</h2>
          <PieChartComponent />
        </div>
        <div style={{
          flex: 1,
          backgroundColor: "#f7f7f7",
          border: "1px solid #ccc",
          borderRadius: "12px",
          padding: "1.5rem"
        }}>
          <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
            <h2 style={{ marginBottom: "1rem" }}>Route-Specific Waste Trend</h2>
          </div>
          <RouteLineChart />
        </div>
      </div>

      {/* Waste by Age Group */}
      <div>
        <h2>Waste by Age Group</h2>
        <BarChartComponent />
      </div>

      {/* Age Group Details */}
      <div style={{ marginTop: "2rem" }}>
        <h2>Age Group Details</h2>
        <p>[Details will be shown here on click of bar chart]</p>
        <AgeGroupDetails />
      </div>
    </div>
  );
}

export default Dashboard;
